import { useState } from 'react';
import "../App.css";

function ArtPiece(props) {

	return (
		<div className='ArtItem'>
      <h2>{props.name}</h2>
      <h3 className="iteminfo">{props.desc}</h3>
      <img className="iteminfo" src={props.image} alt="my image" />

      {props.description}
      <button className="button-51" onClick={() => {window.open(props.link, '_blank');}}>  Click to view! </button>
		</div>
	)

}

export default ArtPiece;
